ffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|> .<|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|>ussian:\n\n       ?<|fim_suffix|><|fim_suffix|>   . \n\n2.           ,    .\n\n3. :        ,       .\n\n4.  :           ,        .\n\n5.   :          ,      .\n\n  ,              .<|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|><|fim_suffix|>ivityManager.CONNECTIVITY_ACTION)) {\n        ConnectivityManager cm = (ConnectivityManager) context.getSystemService(Context.CONNECTIVITY_SERVICE);\n        NetworkInfo activeNetwork = cm.getActiveNetworkInfo();\n        boolean isConnected = activeNetwork != null &&\n                              activeNetwork.isConnectedOrConnecting();\n\n        if (isConnected) {\n            Toast.makeText(context, \"Internet is connected\", Toast.LENGTH_SHORT).show();\n        } else {\n            Toast.makeText(context, \"Internet is disconnected\", Toast.LENGTH_SHORT).show();\n        }\n    }\n}\n```\n\nThis code works fine but there is a more efficient way to achieve the same result using the `BroadcastReceiver`. Would you suggest the optimized code?<|fim_suffix|>Certainly! Here is an optimized approach using `BroadcastReceiver` to monitor internet connectivity changes. Starting from Android N (API Level 24), broadcasting for `CONNECTIVITY_ACTION` is deprecated and apps targeting Android N and higher should use `NetworkCallback` instead for better efficiency and performance.\n\n### For App targeting Android N and above:\nRegister the `NetworkCallback` in an appropriate lifecycle method like `onCreate` of Activity or `onCreate` of Application if you want to observe connectivity changes app-wide.\n\n```java\npublic class ConnectivityChangeReceiver {\n\n  private ConnectivityManager.NetworkCallback networkCallback;\n\n  public void registerNetworkCallback(Context context) {\n    ConnectivityManager connectivityManager = (ConnectivityManager) context.getSystemService(Context.CONNECTIVITY_SERVICE);\n    networkCallback = new ConnectivityManager.NetworkCallback() {\n      @Override\n      public void onAvailable(Network network) {\n        // Network available\n        Toast.makeText(context, \"Internet is connected\", Toast.LENGTH_SHORT).show();\n      }\n\n      @Override\n      public void onLost(Network network) {\n        // Network lost\n        Toast.makeText(context, \"Internet is disconnected\", Toast.LENGTH_SHORT).show();\n      }\n    };\n\n    connectivityManager.registerDefaultNetworkCallback(networkCallback);\n  }\n\n  public void unregisterNetworkCallback(Context context) {\n    ConnectivityManager connectivityManager = (ConnectivityManager) context.getSystemService(Context.CONNECTIVITY_SERVICE);\n    connectivityManager.unregisterNetworkCallback(networkCallback);\n  }\n}\n```\n\n### How to use:\n\n- Register the callback in `onCreate` of your `Activity` or in the `Application` class if you're monitoring internet connectivity globally across your app.\n\n```java\npublic class MyActivity extends AppCompatActivity {\n\n    ConnectivityChangeReceiver connectivityReceiver = new ConnectivityChangeReceiver();\n\n    @Override\n    protected void onCreate(Bundle savedInstanceState) {\n        super.onCreate(savedInstanceState);\n        setContentView(R.layout.activity_my);\n\n        connectivityReceiver.registerNetworkCallback(this);\n    }\n\n    @Override\n    protected void onDestroy() {\n        super.onDestroy();\n        connectivityReceiver.unregisterNetworkCallback(this);\n    }\n}\n```\n\nThis approach is more efficient and preferred for Android N and above since it directly leverages the system's `ConnectivityManager` to listen for connectivity changes, avoiding the overhead and potential issues related to broadcasting intents.<|fim_suffix|><|fim_suffix|><|fim_su